import React from 'react'
import plate from '../Images/plate01.png';
import '../Frontpage/DesignsLayover.css';

export default function DesignsLayover() {
  return (
    <div>
      <img className='plate1' alt='Food plate' src={plate}></img>
      <div className='logo1'>
        <p >Meal Rescue India </p>
      </div>
      <div className='logo2'>
        <p>Meet India's new MRI not the one that scans bodies, but the one that feeds souls.</p>
      </div>
      <div>
      <p>बचा हुआ खाना है? फिकर न करें!<b>'मील रेस्क्यू इंडिया'</b> की मदद से इसे किसी की जरूरत में दे</p>
      </div>
    </div>
  )
}
